  false,\n\t\"url\": null,\n\t\"notes\": \"This plan provides guidelines for administration
  of hunting activity and for development, maintenance, and enforcement of regulations
  and guidelines on Morgan Brake National Wildlife Refuge. It specifically addresses
  the areas of information, access, use patterns, regulations, area restrictions,
  permits, and enforcement. Target species include gray and fox squirrel, raccoon,
  cottontail, swamp rabbit, opossum, beaver, deer, and migratory waterfowl.\",\n\t\"license_title\":
